(22, 'Web Developer', 'tes', 'tes', 'Medan', '2025-06-05', '2025-12-05', '2025-06-10', 1, 'Pengelolaan Operasi', 'SMA/SMK', 1, '2025-06-04 22:56:19', '2025-06-04 22:56:19'),
(24, 'Akuntasi', 'tes', 'tes', 'Medan', '2025-06-06', '2025-12-06', '2025-06-10', 100, 'Anggaran, Akuntansi, dan Pelaporan', 'SMA/SMK', 1, '2025-06-05 21:58:27', '2025-06-05 21:58:27'),
(27, 'Program Development', '<p data-start=\"387\" data-end=\"681\">Kami mencari mahasiswa atau fresh graduate yang antusias, kreatif, dan memiliki semangat tinggi untuk bergabung dalam <strong data-start=\"505\" data-end=\"535\">divisi Program Development</strong>. Anda akan bekerja langsung dengan tim untuk merancang, mengembangkan, dan mengevaluasi program/kegiatan yang berdampak sosial dan berkelanjutan.</p>\r\n<h4 data-start=\"683\" data-end=\"703\">Tanggung Jawab:</h4>\r\n<ul data-start=\"704\" data-end=\"997\">\r\n<li data-start=\"704\" data-end=\"752\">\r\n<p data-start=\"706\" data-end=\"752\">Membantu perencanaan dan desain program kerja.</p>\r\n</li>\r\n<li data-start=\"753\" data-end=\"817\">\r\n<p data-start=\"755\" data-end=\"817\">Melakukan riset kebutuhan masyarakat dan pemangku kepentingan.</p>\r\n</li>\r\n<li data-start=\"818\" data-end=\"872\">\r\n<p data-start=\"820\" data-end=\"872\">Membuat laporan perkembangan program secara berkala.</p>\r\n</li>\r\n<li data-start=\"873\" data-end=\"921\">\r\n<p data-start=\"875\" data-end=\"921\">Mengumpulkan dan mengolah data hasil kegiatan.</p>\r\n</li>\r\n<li data-start=\"922\" data-end=\"997\">\r\n<p data-start=\"924\" data-end=\"997\">Berkoordinasi dengan tim lapangan dan mitra terkait implementasi program.</p>\r\n</li>\r\n</ul>\r\n<h3 data-start=\"1004\" data-end=\"1027\"><strong data-start=\"1011\" data-end=\"1027\">Kualifikasi:</strong></h3>\r\n<ul data-start=\"1028\" data-end=\"1457\">\r\n<li data-start=\"1028\" data-end=\"1161\">\r\n<p data-start=\"1030\" data-end=\"1161\">Mahasiswa aktif/D3/S1 atau fresh graduate (diutamakan jurusan Ilmu Sosial, Kesehatan Masyarakat, Ilmu Komunikasi, atau sejenisnya).</p>\r\n</li>\r\n<li data-start=\"1162\" data-end=\"1227\">\r\n<p data-start=\"1164\" data-end=\"1227\">Mampu berpikir analitis dan memiliki kemampuan problem solving.</p>\r\n</li>\r\n<li data-start=\"1228\" data-end=\"1268\">\r\n<p data-start=\"1230\" data-end=\"1268\">Mampu bekerja secara individu dan tim.</p>\r\n</li>\r\n<li data-start=\"1269\" data-end=\"1328\">\r\n<p data-start=\"1271\" data-end=\"1328\">Memiliki kemampuan menulis dan membuat laporan yang baik.</p>\r\n</li>\r\n<li data-start=\"1329\" data-end=\"1394\">\r\n<p data-start=\"1331\" data-end=\"1394\">Diutamakan memiliki pengalaman organisasi atau kegiatan sosial.</p>\r\n</li>\r\n<li data-start=\"1395\" data-end=\"1457\">\r\n<p data-start=\"1397\" data-end=\"1457\">Terbiasa menggunakan Google Workspace atau Microsoft Office.</p>\r\n</li>\r\n</ul>', '<h3 data-start=\"1464\" data-end=\"1506\"><strong data-start=\"1471\" data-end=\"1506\">Dokumen yang Harus Dilampirkan:</strong></h3>\r\n<ol data-start=\"1507\" data-end=\"1831\">\r\n<li data-start=\"1507\" data-end=\"1537\">\r\n<p data-start=\"1510\" data-end=\"1537\"><strong data-start=\"1510\" data-end=\"1524\">CV terbaru</strong> (format PDF)</p>\r\n</li>\r\n<li data-start=\"1538\" data-end=\"1600\">\r\n<p data-start=\"1541\" data-end=\"1600\"><strong data-start=\"1541\" data-end=\"1558\">Surat Lamaran</strong> (ditujukan kepada [Nama Organisasi Anda])</p>\r\n</li>\r\n<li data-start=\"1601\" data-end=\"1662\">\r\n<p data-start=\"1604\" data-end=\"1662\"><strong data-start=\"1604\" data-end=\"1651\">Portofolio kegiatan atau pengalaman terkait</strong> (jika ada)</p>\r\n</li>\r\n<li data-start=\"1663\" data-end=\"1729\">\r\n<p data-start=\"1666\" data-end=\"1729\"><strong data-start=\"1666\" data-end=\"1691\">Kartu Tanda Mahasiswa</strong> atau bukti status pendidikan terakhir</p>\r\n</li>\r\n<li data-start=\"1730\" data-end=\"1806\">\r\n<p data-start=\"1733\" data-end=\"1806\"><strong data-start=\"1733\" data-end=\"1776\">Surat Rekomendasi atau Pengantar Magang</strong> dari kampus (jika diwajibkan)</p>\r\n</li>\r\n<li data-start=\"1807\" data-end=\"1831\">\r\n<p data-start=\"1810\" data-end=\"1831\"><strong data-start=\"1810\" data-end=\"1831\">Foto diri terbaru</strong></p>\r\n</li>\r\n</ol>', 'Medan', '2025-06-30', '2025-12-30', '2025-06-30', 120, 'Pengelolaan Operasi', 'S1', 1, '2025-06-09 02:46:17', '2025-06-10 00:20:51'),
(37, 'Ekonomi', '<p>tes</p>', '<p>tes</p>', 'Medan', '2025-06-10', '2025-12-30', '2025-06-30', 68, 'Perencanaan Strategis', 'SMA/SMK', 1, '2025-06-10 00:27:56', '2025-06-10 02:03:36'),
(38, 'Staff Legal', '<p>tes</p>', '<p>tes</p>', 'Medan', '2025-06-30', '2025-12-30', '2025-06-20', 1, 'Hukum', 'SMA/SMK', 1, '2025-06-10 02:04:33', '2025-06-10 02:04:33'),
(39, 'Sistem Informasi', '<p>tes</p>', '<p>tes</p>', 'Medan', '2025-06-30', '2025-12-30', '2025-06-20', 150, 'PPSDM', 'S1', 0, '2025-06-10 02:05:18', '2025-06-12 09:49:30'),
(40, 'Desain Komunikasi Visual', '<p>Divisi ini bertanggung jawab atas visual branding organisasi. Mahasiswa magang akan berkontribusi membuat konten visual kampanye, infografis, serta materi media sosial.</p>\r\n<h3 data-start=\"1768\" data-end=\"1801\">Tugas dan Tanggung Jawab:</h3>\r\n<ul data-start=\"1802\" data-end=\"2035\">\r\n<li data-start=\"1802\" data-end=\"1887\">\r\n<p data-start=\"1804\" data-end=\"1887\">Membuat desain poster, brosur, feed, dan reels untuk Instagram, website, dan event.</p>\r\n</li>\r\n<li data-start=\"1888\" data-end=\"1932\">\r\n<p data-start=\"1890\" data-end=\"1932\">Menyusun template presentasi yang menarik.</p>\r\n</li>\r\n<li data-start=\"1933\" data-end=\"1989\">\r\n<p data-start=\"1935\" data-end=\"1989\">Mengolah dan mengedit foto untuk dokumentasi kegiatan.</p>\r\n</li>\r\n<li data-start=\"1990\" data-end=\"2035\">\r\n<p data-start=\"1992\" data-end=\"2035\">Kolaborasi dengan tim media dan komunikasi.</p>\r\n</li>\r\n</ul>\r\n<h3 data-start=\"2037\" data-end=\"2055\">Kualifikasi:</h3>\r\n<ul data-start=\"2056\" data-end=\"2330\">\r\n<li data-start=\"2056\" data-end=\"2131\">\r\n<p data-start=\"2058\" data-end=\"2131\">Mahasiswa aktif DKV, Multimedia, Komunikasi Visual, atau jurusan terkait.</p>\r\n</li>\r\n<li data-start=\"2132\" data-end=\"2197\">\r\n<p data-start=\"2134\" data-end=\"2197\">Menguasai software desain (Canva, Adobe Photoshop/Illustrator).</p>\r\n</li>\r\n<li data-start=\"2198\" data-end=\"2245\">\r\n<p data-start=\"2200\" data-end=\"2245\">Mampu bekerja sesuai tenggat waktu dan brief.</p>\r\n</li>\r\n<li data-start=\"2246\" data-end=\"2298\">\r\n<p data-start=\"2248\" data-end=\"2298\">Kreatif dan up-to-date dengan tren desain digital.</p>\r\n</li>\r\n<li data-start=\"2299\" data-end=\"2330\">\r\n<p data-start=\"2301\" data-end=\"2330\">Melampirkan portofolio karya.</p>\r\n</li>\r\n</ul>', '<h3 data-start=\"2332\" data-end=\"2353\">Dokumen Wajib:</h3>\r\n<ul data-start=\"2354\" data-end=\"2462\">\r\n<li data-start=\"2354\" data-end=\"2360\">\r\n<p data-start=\"2356\" data-end=\"2360\">CV</p>\r\n</li>\r\n<li data-start=\"2361\" data-end=\"2378\">\r\n<p data-start=\"2363\" data-end=\"2378\">Surat Lamaran</p>\r\n</li>\r\n<li data-start=\"2379\" data-end=\"2419\">\r\n<p data-start=\"2381\" data-end=\"2419\">Portofolio Desain (PDF/Link Behance)</p>\r\n</li>\r\n<li data-start=\"2420\" data-end=\"2462\">\r\n<p data-start=\"2422\" data-end=\"2462\">Kartu Mahasiswa / Surat Keterangan Aktif</p>\r\n</li>\r\n</ul>', 'Medan', '2025-06-30', '2025-12-30', '2025-06-20', 1, 'Pengelolaan Operasi', 'S1', 1, '2025-06-10 02:10:55', '2025-06-10 02:10:55'),
(41, 'Content Creator', '<p>Posisi ini bertanggung jawab dalam mengelola media sosial organisasi dan membuat konten yang informatif, edukatif, dan menarik untuk meningkatkan jangkauan dan engagement publik.</p>\r\n<h3 data-start=\"2863\" data-end=\"2896\">Tugas dan Tanggung Jawab:</h3>\r\n<ul data-start=\"2897\" data-end=\"3097\">\r\n<li data-start=\"2897\" data-end=\"2956\">\r\n<p data-start=\"2899\" data-end=\"2956\">Membuat caption, konten harian, dan copywriting edukatif.</p>\r\n</li>\r\n<li data-start=\"2957\" data-end=\"2994\">\r\n<p data-start=\"2959\" data-end=\"2994\">Merancang kalender konten mingguan.</p>\r\n</li>\r\n<li data-start=\"2995\" data-end=\"3042\">\r\n<p data-start=\"2997\" data-end=\"3042\">Membantu dokumentasi kegiatan secara digital.</p>\r\n</li>\r\n<li data-start=\"3043\" data-end=\"3097\">\r\n<p data-start=\"3045\" data-end=\"3097\">Meningkatkan performa akun melalui strategi kreatif.</p>\r\n</li>\r\n</ul>\r\n<h3 data-start=\"3099\" data-end=\"3117\">Kualifikasi:</h3>\r\n<ul data-start=\"3118\" data-end=\"3431\">\r\n<li data-start=\"3118\" data-end=\"3199\">\r\n<p data-start=\"3120\" data-end=\"3199\">Mahasiswa aktif (semua jurusan, diutamakan Komunikasi, Jurnalistik, Marketing).</p>\r\n</li>\r\n<li data-start=\"3200\" data-end=\"3250\">\r\n<p data-start=\"3202\" data-end=\"3250\">Aktif di media sosial dan memahami tren digital.</p>\r\n</li>\r\n<li data-start=\"3251\" data-end=\"3305\">\r\n<p data-start=\"3253\" data-end=\"3305\">Memiliki kemampuan menulis kreatif dan storytelling.</p>\r\n</li>\r\n<li data-start=\"3306\" data-end=\"3377\">\r\n<p data-start=\"3308\" data-end=\"3377\">Mampu mengoperasikan Canva, CapCut/InShot, atau software edit ringan.</p>\r\n</li>\r\n<li data-start=\"3378\" data-end=\"3431\">\r\n<p data-start=\"3380\" data-end=\"3431\">Percaya diri untuk membuat konten video atau reels.</p>\r\n</li>\r\n</ul>', '<h3 data-start=\"3433\" data-end=\"3454\">Dokumen Wajib:</h3>\r\n<ul data-start=\"3455\" data-end=\"3543\">\r\n<li data-start=\"3455\" data-end=\"3461\">\r\n<p data-start=\"3457\" data-end=\"3461\">CV</p>\r\n</li>\r\n<li data-start=\"3462\" data-end=\"3479\">\r\n<p data-start=\"3464\" data-end=\"3479\">Surat Lamaran</p>\r\n</li>\r\n<li data-start=\"3480\" data-end=\"3525\">\r\n<p data-start=\"3482\" data-end=\"3525\">Link akun media sosial (Instagram/TikTok)</p>\r\n</li>\r\n<li data-start=\"3526\" data-end=\"3543\">\r\n<p data-start=\"3528\" data-end=\"3543\">Kartu Mahasiswa</p>\r\n</li>\r\n</ul>', 'Medan', '2025-06-30', '2025-12-30', '2025-06-20', 119, 'Pengelolaan Operasi', 'S1', 0, '2025-06-10 02:12:24', '2025-06-11 12:13:47'),
(42, 'Administrasi Program', '<p>Divisi ini bertugas memastikan kelengkapan data administrasi kegiatan dan menjaga akurasi pelaporan. Mahasiswa magang akan membantu input data, merapikan dokumentasi program, serta menyusun laporan pendukung kegiatan.</p>\r\n<h3 data-start=\"507\" data-end=\"540\">&nbsp;Tugas dan Tanggung Jawab:</h3>\r\n<ul data-start=\"541\" data-end=\"819\">\r\n<li data-start=\"541\" data-end=\"613\">\r\n<p data-start=\"543\" data-end=\"613\">Menginput dan memverifikasi data hasil kegiatan ke sistem/spreadsheet.</p>\r\n</li>\r\n<li data-start=\"614\" data-end=\"669\">\r\n<p data-start=\"616\" data-end=\"669\">Membantu rekap laporan harian, mingguan, dan bulanan.</p>\r\n</li>\r\n<li data-start=\"670\" data-end=\"747\">\r\n<p data-start=\"672\" data-end=\"747\">Menyusun dokumentasi administratif (absensi, notulensi, rekap form survei).</p>\r\n</li>\r\n<li data-start=\"748\" data-end=\"819\">\r\n<p data-start=\"750\" data-end=\"819\">Berkoordinasi dengan tim program dan lapangan terkait kebutuhan data.</p>\r\n</li>\r\n</ul>\r\n<h3 data-start=\"821\" data-end=\"839\">Kualifikasi:</h3>\r\n<ul data-start=\"840\" data-end=\"1131\">\r\n<li data-start=\"840\" data-end=\"931\">\r\n<p data-start=\"842\" data-end=\"931\">Mahasiswa aktif semua jurusan, diutamakan Administrasi, Akuntansi, atau Sistem Informasi.</p>\r\n</li>\r\n<li data-start=\"932\" data-end=\"1011\">\r\n<p data-start=\"934\" data-end=\"1011\">Terampil menggunakan Google Sheets, Microsoft Excel, dan alat manajemen data.</p>\r\n</li>\r\n<li data-start=\"1012\" data-end=\"1063\">\r\n<p data-start=\"1014\" data-end=\"1063\">Teliti, rapi, dan mampu menjaga kerahasiaan data.</p>\r\n</li>\r\n<li data-start=\"1064\" data-end=\"1131\">\r\n<p data-start=\"1066\" data-end=\"1131\">Mampu bekerja secara mandiri dan mengikuti instruksi dengan baik.</p>\r\n</li>\r\n</ul>', '<h3 data-start=\"1133\" data-end=\"1154\">Dokumen Wajib:</h3>\r\n<ul data-start=\"1155\" data-end=\"1308\">\r\n<li data-start=\"1155\" data-end=\"1161\">\r\n<p data-start=\"1157\" data-end=\"1161\">CV</p>\r\n</li>\r\n<li data-start=\"1162\" data-end=\"1179\">\r\n<p data-start=\"1164\" data-end=\"1179\">Surat Lamaran</p>\r\n</li>\r\n<li data-start=\"1180\" data-end=\"1224\">\r\n<p data-start=\"1182\" data-end=\"1224\">Kartu Mahasiswa / Surat Keterangan Aktif</p>\r\n</li>\r\n<li data-start=\"1225\" data-end=\"1308\">\r\n<p data-start=\"1227\" data-end=\"1308\">Contoh hasil kerja (opsional, seperti rekap data atau laporan yang pernah dibuat)</p>\r\n</li>\r\n</ul>', 'Medan', '2025-06-30', '2025-12-30', '2025-06-20', 120, 'Pengelolaan Operasi', 'SMA/SMK', 0, '2025-06-10 02:14:05', '2025-06-12 09:43:46'),
